import { ChatEngine } from 'react-chat-engine';
import 'chat/style/chat.css';

const Chat = () => {
    return (
        <>
            <ChatEngine
                height="100vh"
                projectID="452f03af-2d74-4651-9146-040772d96225"
                userName="seulgi"
                userSecret="1234"
            />
        </>
    );
};

export default Chat;
